import React from 'react';
import Vscode from '../images/editors/img_vscode.png';
import Atom from '../images/editors/img_atom.png';
import Sublime from '../images/editors/img_sublime.png';
import Brackets from '../images/editors/img_brackets.png';

export const EditorsList = [
    {   
        id:"1",
        name:"Vscode",
        source:Vscode,
        url:"https://code.visualstudio.com/",
    },
    {   
        id:"2",
        name:"Atom",
        source:Atom,
        url:"https://atom.io/",
    },
    {   
        id:"3",
        name:"Sublime",
        source:Sublime,
        url:"https://www.sublimetext.com/",
    },
    {   
        id:"4",
        name:"Brackets",
        source:Brackets,
        url:"http://brackets.io/",
    },
]
